import React from 'react';

//TODO : Add images to the slideshow
const slideImages = [
  {
    'url' : 'TODO URL',
    'alt' : 'Alt Image'
  }
];

const HomeBGStyle = {
  background: '../image/generic.jpg',
  height: '100vh',
  backgroundPosition:'center',
  backgroundRepeat: 'no-repeat',
  backgroundSize: 'cover',
  backgroundColor: 'black'
}

const Home = () => {
  const images = slideImages.map((image, index) =>{
    return(
      <div id="home" className="col-md-12">
      </div>
    );
  });
  return <section id="home" className="row">{images}</section>
};

export default Home;
